options.getOption:
const scoreColors = (alpha = 1) => [
  `rgba(84, 186, 70, ${alpha})`,
  `rgba(255, 255, 57, ${alpha})`,
  `rgba(255, 147, 38, ${alpha})`,
  `rgba(201, 36, 41, ${alpha})`,
  `rgba(100, 100, 100, ${alpha})`,
];

const scoreColor = (score, alpha = 1) => {
  if (score === 'A') return scoreColors(alpha)[0];
  if (score === 'B') return scoreColors(alpha)[1];
  if (score === 'C') return scoreColors(alpha)[2];
  if (score === 'D') return scoreColors(alpha)[3];
  return scoreColors(alpha)[4];
};


let indicator, value, datas = [];
let colors = [];

data.series.map((s) => {
  indicator = s.fields.find((f) => f.name === 'label').values;
  value = s.fields.find((f) => f.name === 'value').values;
  for (let i = 0; i < indicator.length; i++) {
    const item = {
      value: value[i],
      name: indicator[i]
    };
    colors.push(scoreColor(indicator[i]));
    datas.push(item);
  }
});

return {
  tooltip: {
    trigger: 'item'
  },
  series: [
    {
      name: 'Systems',
      type: 'pie',
      radius: '80%',
      data: datas,
      emphasis: {
        itemStyle: {
          shadowBlur: 10,
          shadowOffsetX: 0,
          shadowColor: 'rgba(0, 0, 0, 0.5)'
        }
      }
    }
  ],
  color: colors
};

